webpackJsonp([0x9becc2eed744],{391:function(A,a){A.exports={data:{site:{meta:{title:"CIID Final Project Kelvyn Marte",description:"CIID Final Project Kelvyn Marte",url:"https://kelvynmarte.github.io/ciid-final-project-documentation",author:"Kelvyn Ornette Sol Marte",twitter:"kelvynmarte"}},post:{id:"/Users/kelvyn/Projects/2017_08 CIID Final Project/05 Production/Web/ciid-final-project-documentation/src/pages/concepting/index.md absPath of file >>> MarkdownRemark",html:'<blockquote>\n<p>66% of All Humans Will Live in Cities by 2050</p>\n<footer><cite>—UN, 2014</cite></footer>\n</blockquote>\n<h2>Collective Brainstorm</h2>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; margin-bottom: 1.0725rem;; max-width: 750px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 100.06253908692932%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="collective brainstorm"\n        title=""\n        src="/static/b58626844e8bafc4731f49d8a6d8a627-df60d.jpg"\n        srcset="/static/b58626844e8bafc4731f49d8a6d8a627-45144.jpg 188w,\n/static/b58626844e8bafc4731f49d8a6d8a627-2f941.jpg 375w,\n/static/b58626844e8bafc4731f49d8a6d8a627-df60d.jpg 750w,\n/static/b58626844e8bafc4731f49d8a6d8a627-b1889.jpg 1125w,\n/static/b58626844e8bafc4731f49d8a6d8a627-1d6f8.jpg 1500w,\n/static/b58626844e8bafc4731f49d8a6d8a627-a0910.jpg 1599w"\n        sizes="(max-width: 750px) 100vw, 750px"\n      />\n    </span>\n  </span>\n  </p>\n<p>The third week we had collective brainstorms so I started to think about HMWs for the session I had the following day. It felt too early to have an ideation session, but I guess at one point it has to start.\nIn addition I had an very interesting talk with Annelie about her New Europe Project and got a lot of inspiration and discussion always helps to make things a bit more concrete.\nTo come up with a lot of HMWs I wrote a quick HMW generator Website to come up with some crazy HMWs, which was fun it generated a lot of crazy HMWs.</p>\n<p>The HMWs I where:</p>\n<ul>\n<li>How might we build a collective identity of a neighborhood in an engaging way?</li>\n<li>How might we design for calm moments in the city using play? — did not work so well.</li>\n<li>How might we design for engaging small democratic negotiations in a community centre?</li>\n<li>How might we promote social interactions in for people who only live in a city for some days? — I did not communicate it properly to the whole group I have the feeling.</li>\n<li>How might we use asynchronous play in the urban space? – not used during the collective brainstorm.</li>\n</ul>\n<p>Overall I got some inspiration but also I had the impression everyone was quite tired my ideation being the last of three hours in a row. Prompts and insights on cards would be a good idea to try out next time.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; margin-bottom: 1.0725rem;; max-width: 750px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="collective brainstorm cluster1"\n        title=""\n        src="/static/ca653a6035ccb226a7bbf55b26be8053-df60d.jpg"\n        srcset="/static/ca653a6035ccb226a7bbf55b26be8053-45144.jpg 188w,\n/static/ca653a6035ccb226a7bbf55b26be8053-2f941.jpg 375w,\n/static/ca653a6035ccb226a7bbf55b26be8053-df60d.jpg 750w,\n/static/ca653a6035ccb226a7bbf55b26be8053-b1889.jpg 1125w,\n/static/ca653a6035ccb226a7bbf55b26be8053-1d6f8.jpg 1500w,\n/static/ca653a6035ccb226a7bbf55b26be8053-c49a5.jpg 1600w"\n        sizes="(max-width: 750px) 100vw, 750px"\n      />\n    </span>\n  </span>\n  \n<em>Ideas Cluster 1, with ideas around connecting the neighborhood through a shared identity, but also just get people together</em></p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; margin-bottom: 1.0725rem;; max-width: 750px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="collective brainstorm cluster2"\n        title=""\n        src="/static/40cc4d73851e0daf3477db25c96b3757-df60d.jpg"\n        srcset="/static/40cc4d73851e0daf3477db25c96b3757-45144.jpg 188w,\n/static/40cc4d73851e0daf3477db25c96b3757-2f941.jpg 375w,\n/static/40cc4d73851e0daf3477db25c96b3757-df60d.jpg 750w,\n/static/40cc4d73851e0daf3477db25c96b3757-b1889.jpg 1125w,\n/static/40cc4d73851e0daf3477db25c96b3757-1d6f8.jpg 1500w,\n/static/40cc4d73851e0daf3477db25c96b3757-c49a5.jpg 1600w"\n        sizes="(max-width: 750px) 100vw, 750px"\n      />\n    </span>\n  </span>\n  \n<em>Ideas Cluster 2, with ideas around voting and visualisations in the urban environment</em></p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; margin-bottom: 1.0725rem;; max-width: 750px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="collective brainstorm cluster3"\n        title=""\n        src="/static/ed94aa5dd1811d80e26e2107b3325ab0-df60d.jpg"\n        srcset="/static/ed94aa5dd1811d80e26e2107b3325ab0-45144.jpg 188w,\n/static/ed94aa5dd1811d80e26e2107b3325ab0-2f941.jpg 375w,\n/static/ed94aa5dd1811d80e26e2107b3325ab0-df60d.jpg 750w,\n/static/ed94aa5dd1811d80e26e2107b3325ab0-b1889.jpg 1125w,\n/static/ed94aa5dd1811d80e26e2107b3325ab0-1d6f8.jpg 1500w,\n/static/ed94aa5dd1811d80e26e2107b3325ab0-c49a5.jpg 1600w"\n        sizes="(max-width: 750px) 100vw, 750px"\n      />\n    </span>\n  </span>\n  \n<em>Ideas Cluster 3, with ideas around shared identity but also goods</em></p>\n<h2>Related Inspiring Projects</h2>\n<p><a href="https://www.are.na/share/FCnqkGj">View related inspiring projects at are.na</a></p>\n<!--<iframe width="560" height="315" src="https://www.youtube.com/embed/rIPfpGCxONQ?rel=0&amp;controls=0&amp;showinfo=0" frameborder="0" allowfullscreen></iframe>-->',frontmatter:{layout:"post",title:"Concepting",path:"/concepting/",categories:null,date:"2016/03/01"}}},pathContext:{path:"/concepting/"}}}});
